    <FCard img={Search} head="ADD USER PROFILE" text="Users will be able to create profiles for comapnies to look"/> 
    </div>
    <div className="col-md-3">
    <FCard img={Office} head="ADD USER PROFILE" text="Users will be able to create profiles for comapnies to look"/> 
    </div>
    <div className="col-md-3">
    <FCard img={Blog} head="ADD USER PROFILE" text="Users will be able to create profiles for comapnies to look"/> 
    </div>
  </div>
  </div> 
    )
}

export default Features
